import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { GetTaskList } from '../../API/Api';
import { GetTaskList1, GetTaskList2 } from '../../Redux/Actions/GetTaskListAction';
import { LoaderAction } from '../../Redux/Actions/LoaderAction';


function TaskShow() {
  const disptach = useDispatch()


  useEffect(() => {
    if (TaskList == null) {
      disptach(LoaderAction(true))
    }
    return () => {
      GetTaskList(disptach, sessionStorage.getItem("UserLogin"))

    }
  }, [])

  const TaskList = useSelector((state) => state.GettaskListReducer);
  console.log(TaskList)

  return (
    <>
      <div className="input-group">
        <div className="input-group-text">
          <input className="form-check-input mt-0" type="radio" value="" aria-label="Radio button for following text input" />
        </div>
        <input type="text" className="form-control" aria-label="Text input with radio button" />
      </div>
      {TaskList != null ? TaskList.map((x) => {
        return <ul key={x.TaskId}><li key={x.TaskId + 1}>{x.Task}</li>
          <li key={x.TaskId + 2}>{x.Date}</li>

        </ul>
      }) : <h1>No Data</h1>}

    </>

  )
}

export default TaskShow
